INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 1, 101, 1, 0, 0.029, 160, 1.5, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 0, 1, 105, 122601);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 2, 102, 3, 1, 0.014, 120, 2.5, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2, 0, 0, 111, 122401);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 3, 103, 2, 0, 0.017, 350, 2.5, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 3, 1, 0, 105, 122501);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 4, 104, 3, 1, 0.016, 130, 1.5, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 4, 0, 0, 105, 107501);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 5, 105, 1, 0, 0.014, 160, 2.5, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 5, 0, 1, 105, 107601);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (120, 6, 106, 2, 0, 0.029, 255, 3.5, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 6, 1, 0, 103, 107801);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (120, 7, 107, 1, 0, 0.013, 160, 3.5, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 7, 0, 1, 103, 110601);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 8, 108, 2, 0, 0.014, 350, 2.5, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 8, 1, 0, 103, 110401);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 9, 109, 3, 1, 0.012, 130, 1.5, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 9, 0, 0, 100, 110501);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 10, 110, 1, 0, 0.014, 200, 2.5, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 10, 0, 1, 103, 115701);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 11, 111, 2, 0, 0.071, 350, 2.5, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 11, 1, 0, 103, 113601);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (120, 12, 112, 3, 1, 0.014, 130, 1.5, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 12, 0, 0, 103, 107901);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 13, 113, 2, 0, 0.022, 200, 1.5, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 13, 0, 1, 105, 108001);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 14, 114, 1, 0, 0.031, 160, 2.5, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 14, 0, 1, 108, 110301);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 15, 115, 1, 1, 0.036, 130, 0.5, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 15, 0, 0, 105, 107701);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 16, 116, 2, 0, 0.048, 350, 3.5, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 16, 1, 0, 95, 113101);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 17, 117, 3, 1, 0.043, 130, 1.5, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 17, 0, 0, 105, 113301);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 18, 118, 2, 1, 0.018, 130, 1.5, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 18, 0, 0, 95, 113201);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 19, 119, 2, 0, 0.021, 160, 2.5, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 19, 0, 1, 108, 117001);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 20, 120, 1, 0, 0.036, 255, 2.5, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 20, 1, 0, 105, 113501);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 21, 121, 3, 0, 0.02, 350, 2.5, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 21, 1, 0, 105, 113401);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 22, 122, 1, 1, 0.018, 130, 2.5, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 22, 0, 0, 105, 110101);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 23, 123, 3, 0, 0.03, 160, 3.5, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 23, 0, 1, 111, 110001);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 24, 124, 1, 1, 0.027, 130, 1.5, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 24, 0, 0, 103, 117201);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 25, 125, 2, 0, 0.02, 160, 3.5, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 25, 0, 1, 108, 117301);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 26, 126, 3, 0, 0.04, 350, 2.5, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 26, 1, 0, 105, 117401);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 27, 127, 1, 0, 0.009, 350, 3.5, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 27, 1, 0, 105, 117101);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (120, 28, 128, 1, 0, 0.022, 255, 3.5, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 28, 1, 0, 105, 122901);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (110, 29, 129, 3, 1, 0.028, 130, 2.5, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 29, 0, 0, 105, 122801);
INSERT INTO `v1_7d7e9b83e071f3c832b07d227314ad4b838f9f0366dfca21456d5a998888b656` VALUES (105, 30, 130, 2, 0, 0.023, 130, 3.5, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 30, 0, 1, 108, 122701);
